import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav style={{
      background: "#232323",
      padding: "1rem 0",
      marginBottom: "2rem",
      boxShadow: "0 2px 8px rgba(0,0,0,0.15)"
    }}>
      <div className="container" style={{display: "flex", alignItems: "center", justifyContent: "space-between"}}>
        <Link to="/" style={{fontWeight: "bold", fontSize: "1.5rem", color: "#ff9800"}}>MovieBooking</Link>
        <div>
          <Link to="/" style={{margin: "0 1rem"}}>Home</Link>
          <Link to="/faq" style={{margin: "0 1rem"}}>FAQ</Link>
          <Link to="/contact" style={{margin: "0 1rem"}}>Contact</Link>
          <Link to="/login" style={{margin: "0 1rem"}}>Login</Link>
          <Link to="/signup" style={{margin: "0 1rem"}}>Signup</Link>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
